import React from 'react';
import { Box ,Button, Layer, Text} from 'grommet';
import { Close } from 'grommet-icons';
import { Notification } from 'grommet-icons';

class Yui extends React.Component{
    constructor(props) {
        super(props);

        this.state = {
        };
    }

    render(){
        return(<Box
            background = "white"

        >
            <Box 
                direction = "column"
                height="small" 
                overflow="auto" 
                border={{
                    "color": "border",
                    "size": "medium",
                    "style": "dashed",
                    "side": "all"
                  }}
                  pad = {{
                    "vertical": "medium",
                    "horizontal": "medium",
                    "top": "medium",
                    "bottom": "medium",
                    "left": "medium",
                    "right": "medium"
                  }}
            >
                <p>this is photo</p>
            </Box>
        </Box>)
    }
}

export default Yui;
